"use strict";(self.webpackChunkmy_website=self.webpackChunkmy_website||[]).push([[74712],{4201:(n,e,t)=>{t.r(e),t.d(e,{assets:()=>a,contentTitle:()=>c,default:()=>l,frontMatter:()=>s,metadata:()=>r,toc:()=>u});const r=JSON.parse('{"id":"\u53e4\u8bd7\u8bcd\u5e93/countryside","title":"countryside","description":"\u65e5\u7167\u9999\u7089\u751f\u7d2b\u70df\uff0c\u9065\u770b\u7011\u5e03\u6302\u524d\u5ddd\u3002\u98de\u6d41\u76f4\u4e0b\u4e09\u5343\u5c3a\uff0c\u7591\u662f\u94f6\u6cb3\u843d\u4e5d\u5929\u3002","source":"@site/learn/\u53e4\u8bd7\u8bcd\u5e93/countryside.md","sourceDirName":"\u53e4\u8bd7\u8bcd\u5e93","slug":"/\u53e4\u8bd7\u8bcd\u5e93/countryside","permalink":"/learn/\u53e4\u8bd7\u8bcd\u5e93/countryside","draft":false,"unlisted":false,"editUrl":"https://github.com/teabagging/security/edit/main/website/learn/\u53e4\u8bd7\u8bcd\u5e93/countryside.md","tags":[],"version":"current","frontMatter":{},"sidebar":"devDocsSidebar","previous":{"title":"boudoirripinings","permalink":"/learn/\u53e4\u8bd7\u8bcd\u5e93/boudoirripinings"},"next":{"title":"encouragement","permalink":"/learn/\u53e4\u8bd7\u8bcd\u5e93/encouragement"}}');var o=t(74848),i=t(28453);const s={},c=void 0,a={},u=[];function d(n){const e={p:"p",...(0,i.R)(),...n.components};return(0,o.jsx)(e.p,{children:"\u65e5\u7167\u9999\u7089\u751f\u7d2b\u70df\uff0c\u9065\u770b\u7011\u5e03\u6302\u524d\u5ddd\u3002\u98de\u6d41\u76f4\u4e0b\u4e09\u5343\u5c3a\uff0c\u7591\u662f\u94f6\u6cb3\u843d\u4e5d\u5929\u3002\n\u957f\u6c5f\u60b2\u5df2\u6ede\uff0c\u4e07\u91cc\u5ff5\u5c06\u5f52\u3002\u51b5\u5c5e\u9ad8\u98ce\u665a\uff0c\u5c71\u5c71\u9ec4\u53f6\u98de\u3002\n\u7a7a\u5c71\u65b0\u96e8\u540e\uff0c\u5929\u6c14\u665a\u6765\u79cb\u3002\u660e\u6708\u677e\u95f4\u7167\uff0c\u6e05\u6cc9\u77f3\u4e0a\u6d41\u3002 \u7af9\u55a7\u5f52\u6d63\u5973\uff0c\u83b2\u52a8\u4e0b\u6e14\u821f\u3002\u968f\u610f\u6625\u82b3\u6b47\uff0c\u738b\u5b59\u81ea\u53ef\u7559\u3002\n\u83ab\u7b11\u519c\u5bb6\u814a\u9152\u6d51\uff0c\u4e30\u5e74\u7559\u5ba2\u8db3\u9e21\u8c5a\u3002\u5c71\u91cd\u6c34\u590d\u7591\u65e0\u8def\uff0c\u67f3\u6697\u82b1\u660e\u53c8\u4e00\u6751\u3002\u8427\u9f13\u8ffd\u968f\u6625\u793e\u8fd1\uff0c\u8863\u51a0\u7b80\u6734\u53e4\u98ce\u5b58\u3002\u4ece\u4eca\u82e5\u8bb8\u95f2\u4e58\u6708\uff0c\u62c4\u6756\u65e0\u65f6\u591c\u53e9\u95e8\u3002\n\u6545\u4eba\u5177\u9e21\u9ecd\uff0c\u9080\u6211\u81f3\u7530\u5bb6\u3002\u7eff\u6811\u6751\u8fb9\u5408\uff0c\u9752\u5c71\u90ed\u5916\u659c\u3002 \u5f00\u7b75\u9762\u573a\u5703\uff0c\u628a\u9152\u8bdd\u6851\u9ebb\u3002\u5f85\u5230\u91cd\u9633\u65e5\uff0c\u8fd8\u6765\u5c31\u83ca\u82b1\u3002\n\u79cd\u8c46\u5357\u5c71\u4e0b\uff0c\u8349\u76db\u8c46\u82d7\u7a00\u3002\u6668\u5174\u7406\u8352\u79fd\uff0c\u5e26\u6708\u8377\u9504\u5f52\u3002\u9053\u72ed\u8349\u6728\u957f\uff0c\u5915\u9732\u6cbe\u6211\u8863\u3002\u8863\u6cbe\u4e0d\u8db3\u60dc\uff0c\u4f46\u4f7f\u613f\u65e0\u8fdd\u3002\n\u6c5f\u5357\u51b0\u4e0d\u95ed\uff0c\u5c71\u6cfd\u6c14\u6f5c\u901a\u3002\u814a\u6708\u95fb\u5c71\u9e1f\uff0c\u5bd2\u5d16\u89c1\u86f0\u718a\u3002\u67f3\u6797\u6625\u534a\u5408\uff0c\u837b\u7b0b\u4e71\u65e0\u4e1b\u3002\u56de\u9996\u91d1\u9675\u5cb8\uff0c\u4f9d\u4f9d\u5411\u5317\u98ce\u3002\n\u671d\u8f9e\u767d\u5e1d\u5f69\u4e91\u95f4\uff0c\u5343\u91cc\u6c5f\u9675\u4e00\u65e5\u8fd8\u3002\u4e24\u5cb8\u733f\u58f0\u557c\u4e0d\u4f4f\uff0c\u8f7b\u821f\u5df2\u8fc7\u4e07\u91cd\u5c71\u3002\n\u7eff\u6ce2\u6625\u6d6a\u6ee1\u524d\u9642\uff0c\u6781\u76ee\u8fde\u4e91\u7f62\u4e9a\u80a5\u3002\u66f4\u88ab\u9e6d\u9e5a\u5343\u70b9\u96ea\uff0c\u7834\u70df\u6765\u5165\u753b\u5c4f\u98de\u3002\n\u4f17\u9e1f\u9ad8\u98de\u5c3d\uff0c\u5b64\u4e91\u72ec\u53bb\u95f2\u3002\u76f8\u770b\u4e24\u4e0d\u538c\uff0c\u53ea\u6709\u656c\u4ead\u5c71\u3002\n\u5c11\u65e0\u9002\u4fd7\u97f5\uff0c\u6027\u672c\u7231\u4e18\u5c71\u3002\u8bef\u843d\u5c18\u7f51\u4e2d\uff0c\u4e00\u53bb\u4e09\u5341\u5e74\u3002\u7f81\u9e1f\u604b\u65e7\u6797\uff0c\u6c60\u9c7c\u601d\u6545\u6e0a\u3002\u5f00\u8352\u5357\u91ce\u9645\uff0c\u5b88\u62d9\u5f52\u56ed\u7530\u3002\u65b9\u5b85\u5341\u4f59\u4ea9\uff0c\u8349\u5c4b\u516b\u4e5d\u95f4\u3002\u6986\u67f3\u836b\u540e\u6a90\uff0c\u6843\u674e\u7f57\u5802\u524d\u3002\u66a7\u66a7\u8fdc\u4eba\u6751\uff0c\u4f9d\u4f9d\u589f\u91cc\u70df\u3002\u72d7\u5420\u6df1\u5df7\u4e2d\uff0c\u9e21\u9e23\u6851\u6811\u98a0\u3002\u6237\u5ead\u65e0\u5c18\u6742\n\u516b\u6708\u6e56\u6c34\u5e73\uff0c\u6db5\u865a\u6df7\u592a\u6e05\u3002\u6c14\u84b8\u4e91\u68a6\u6cfd\uff0c\u6ce2\u64bc\u5cb3\u9633\u57ce\u3002 \u6b32\u6d4e\u65e0\u821f\u696b\uff0c\u7aef\u5c45\u803b\u5723\u660e\u3002\u5750\u89c2\u5782\u9493\u8005\uff0c\u7a7a\u6709\u7fa1\u9c7c\u60c5\u3002\n\u6885\u5b50\u91d1\u9ec4\u674f\u5b50\u80a5\uff0c\u9ea6\u82b1\u96ea\u767d\u83dc\u82b1\u7a00\u3002\u65e5\u957f\u7bf1\u843d\u65e0\u4eba\u8fc7\uff0c\u60df\u6709\u873b\u8713\u86f1\u8776\u98de\u3002\u4e94\u6708\u6c5f\u5434\u9ea6\u79c0\u5bd2\uff0c\u79fb\u79e7\u62ab\u7d6e\u5c1a\u8863\u5355\u3002\u7a3b\u6839\u79d1\u6597\u884c\u5982\u5757\uff0c\u7530\u6c34\u4eca\u5e74\u4e00\u5c3a\u5bbd\u3002\u4e8c\u9ea6\u4ff1\u79cb\u6597\u767e\u94b1\uff0c\u7530\u5bb6\u5524\u4f5c\u5c0f\u4e30\u5e74\u3002\u997c\u7089\u996d\u7511\u65e0\u9965\u8272\uff0c\u63a5\u5230\u897f\u98ce\u719f\u7a3b\u5929\u3002\u767e\u6cb8\u7f32\u6c64\u96ea\n\u4e2d\u5c81\u9887\u597d\u9053\uff0c\u665a\u5bb6\u5357\u5c71\u9672\u3002\u5174\u6765\u6bcf\u72ec\u5f80\uff0c\u80dc\u4e8b\u7a7a\u81ea\u77e5\u3002 \u884c\u5230\u6c34\u7a77\u5904\uff0c\u5750\u770b\u4e91\u8d77\u65f6\u3002\u5076\u7136\u503c\u6797\u53df\uff0c\u8c08\u7b11\u65e0\u8fd8\u671f\u3002\n\u4e16\u5473\u5e74\u6765\u8584\u4f3c\u7eb1\uff0c\u8c01\u4ee4\u9a91\u9a6c\u5ba2\u4eac\u534e\u3002\u5c0f\u697c\u4e00\u591c\u542c\u6625\u96e8\uff0c\u6df1\u5df7\u660e\u671d\u5356\u674f\u82b1\u3002\u77ee\u7eb8\u659c\u884c\u95f2\u4f5c\u8349\uff0c\u6674\u7a97\u7ec6\u4e73\u620f\u5206\u8336\u3002\u7d20\u8863\u83ab\u8d77\u98ce\u5c18\u53f9\uff0c\u72b9\u53ca\u6e05\u660e\u53ef\u5230\u5bb6\u3002\n\u8863\u4e0a\u5f81\u5c18\u6742\u9152\u75d5\uff0c\u8fdc\u6e38\u65e0\u5904\u4e0d\u6d88\u9b42\u3002\u6b64\u8eab\u5408\u662f\u8bd7\u4eba\u672a\uff1f\u7ec6\u96e8\u9a91\u9a74\u5165\u5251\u95e8\u3002\n\u592a\u4e59\u8fd1\u5929\u90fd\uff0c\u8fde\u5c71\u63a5\u6d77\u9685\u3002\u767d\u4e91\u56de\u671b\u5408\uff0c\u9752\u972d\u5165\u770b\u65e0\u3002 \u5206\u91ce\u4e2d\u5cf0\u53d8\uff0c\u9634\u6674\u4f17\u58d1\u6b8a\u3002\u6b32\u6295\u4eba\u5904\u5bbf\uff0c\u9694\u6c34\u95ee\u6a35\u592b\u3002\n\u91ce\u5916\u7f55\u4eba\u4e8b\uff0c\u7a77\u5df7\u5be1\u8f6e\u9785\u3002\u767d\u65e5\u63a9\u8346\u6249\uff0c\u865a\u5ba4\u7edd\u5c18\u60f3\u3002\u65f6\u590d\u589f\u66f2\u4eba\uff0c\u62ab\u8349\u5171\u6765\u5f80\u3002\u76f8\u89c1\u65e0\u6742\u8a00\uff0c\u4f46\u9053\u6851\u9ebb\u957f\u3002\u6851\u9ebb\u65e5\u5df2\u957f\uff0c\u6211\u571f\u65e5\u5df2\u5e7f\u3002\u5e38\u6050\u971c\u9730\u81f3\uff0c\u96f6\u843d\u540c\u8349\u83bd\u3002\n\u4e45\u53bb\u5c71\u6cfd\u6e38\uff0c\u6d6a\u83bd\u6797\u91ce\u5a31\u3002\u8bd5\u643a\u5b50\u4f84\u8f88\uff0c\u62ab\u699b\u6b65\u8352\u589f\u3002\u5f98\u5f8a\u4e18\u5784\u95f4\uff0c\u4f9d\u4f9d\u6614\u4eba\u5c45\u3002\u4e95\u7076\u6709\u9057\u5904\uff0c\u6851\u7af9\u6b8b\u6747\u682a\u3002\u501f\u95ee\u91c7\u85aa\u8005\uff0c\u6b64\u4eba\u7686\u7109\u5982\uff1f\u85aa\u8005\u5411\u6211\u8a00\uff0c\u6b7b\u6ca1\u65e0\u590d\u4f59\u3002\u4e00\u4e16\u5f02\u671d\u5e02\uff0c\u6b64\u8bed\u771f\u4e0d\u865a\u3002\u4eba\u751f\u4f3c\u5e7b\u5316\uff0c\u7ec8\u5f53\u5f52\u7a7a\u65e0\u3002\n\u6005\u6068\u72ec\u7b56\u8fd8\uff0c\u5d0e\u5c96\u5386\u699b\u66f2\u3002\u5c71\u6da7\u6e05\u4e14\u6d45\uff0c\u53ef\u4ee5\u6fef\u543e\u8db3\u3002\u6f09\u6211\u65b0\u719f\u9152\uff0c\u53ea\u9e21\u62db\u8fd1\u5c40\u3002\u65e5\u5165\u5ba4\u4e2d\u6697\uff0c\u8346\u85aa\u4ee3\u660e\u70db\u3002\u6b22\u6765\u82e6\u5915\u77ed\uff0c\u5df2\u590d\u81f3\u5929\u65ed\u3002\n\u677e\u53f6\u582a\u4e3a\u9152\uff0c\u6625\u6765\u917f\u51e0\u591a\u3002\u4e0d\u8f9e\u5c71\u8def\u8fdc\uff0c\u8e0f\u96ea\u4e5f\u76f8\u8fc7\u3002\n\u67f3\u82b1\u6df1\u5df7\u5348\u9e21\u58f0\uff0c\u6851\u53f6\u5c16\u65b0\u7eff\u672a\u6210\u3002\u5750\u7761\u89c9\u6765\u65e0\u4e00\u4e8b\uff0c\u6ee1\u7a97\u6674\u65e5\u770b\u8695\u751f\u3002\u571f\u818f\u6b32\u52a8\u96e8\u9891\u50ac\uff0c\u4e07\u8349\u5343\u82b1\u4e00\u9977\u5f00\uff1b\u820d\u540e\u8352\u7566\u72b9\u7eff\u79c0\uff0c\u90bb\u5bb6\u97ad\u7b0b\u8fc7\u5899\u6765\u3002\u9ad8\u7530\u4e8c\u9ea6\u63a5\u5c71\u9752\uff0c\u508d\u6c34\u4f4e\u7530\u7eff\u672a\u8015\uff1b\u6843\u5947\u6ee1\u6751\u6625\u4f3c\u9526\uff0c\u8e0f\u6b4c\u690e\u9f13\u8fc7\u6e05\u660e\u3002\u8001\u76c6\u521d\u719f\u675c\n\u6728\u672b\u8299\u84c9\u82b1\uff0c\u5c71\u4e2d\u53d1\u7ea2\u843c\u3002\u6da7\u6237\u5bc2\u65e0\u4eba\uff0c\u7eb7\u7eb7\u5f00\u4e14\u843d\u3002\n\u5317\u5c71\u767d\u4e91\u91cc\uff0c\u9690\u8005\u81ea\u6021\u60a6\u3002\u76f8\u671b\u8bd5\u767b\u9ad8\uff0c\u5fc3\u98de\u9010\u9e1f\u706d\u3002 \u6101\u56e0\u8584\u66ae\u8d77\uff0c\u5174\u662f\u6e05\u79cb\u53d1\u3002\u65f6\u89c1\u5f52\u6751\u4eba\uff0c\u6c99\u884c\u6e21\u5934\u6b47\u3002 \u5929\u8fb9\u6811\u82e5\u8360\uff0c\u6c5f\u7554\u821f\u5982\u6708\u3002\u4f55\u5f53\u8f7d\u9152\u6765\uff0c\u5171\u9189\u91cd\u9633\u8282\u3002\n\u5782\u9493\u5750\u76d8\u77f3\uff0c\u6c34\u6e05\u5fc3\u4ea6\u95f2\u3002\u9c7c\u884c\u6f6d\u6811\u4e0b\uff0c\u733f\u6302\u5c9b\u85e4\u95f4\u3002 \u6e38\u5973\u6614\u89e3\u4f69\uff0c\u4f20\u95fb\u4e8e\u6b64\u5c71\u3002\u6c42\u4e4b\u4e0d\u53ef\u5f97\uff0c\u6cbf\u6708\u68f9\u6b4c\u8fd8\u3002\n\u518d\u89c1\u5c01\u4faf\u4e07\u6237\uff0c\u7acb\u8c08\u8d50\u74a7\u4e00\u53cc\u3002\u8bb5\u80dc\u8026\u8015\u5357\u4ea9\uff0c\u4f55\u5982\u9ad8\u5367\u4e1c\u7a97\u3002\n\u592b\u56e0\u5175\u6b7b\u5b88\u84ec\u8305\uff0c\u9ebb\u82ce\u8863\u886b\u9b13\u53d1\u7126\u3002\u6851\u67d8\u5e9f\u6765\u72b9\u7eb3\u7a0e\uff0c\u7530\u56ed\u8352\u540e\u5c1a\u5f81\u82d7\u3002\u65f6\u6311\u91ce\u83dc\u548c\u6839\u716e\uff0c\u65cb\u65ab\u751f\u67f4\u5e26\u53f6\u70e7\u3002\u4efb\u662f\u6df1\u5c71\u66f4\u6df1\u5904\uff0c\u4e5f\u5e94\u65e0\u8ba1\u907f\u5f81\u5fad\u3002\n\u538c\u89c1\u5343\u95e8\u4e07\u6237\uff0c\u7ecf\u8fc7\u5317\u91cc\u5357\u90bb\u3002\u5b98\u5e9c\u9e23\u73c2\u6709\u5e95\uff0c\u5d06\u5cd2\u6563\u53d1\u4f55\u4eba\u3002\n\u5c4b\u4e0a\u6625\u9e20\u9e23\uff0c\u6751\u8fb9\u674f\u82b1\u767d\u3002\u6301\u65a7\u4f10\u8fdc\u626c\uff0c\u8377\u9504\u89c7\u6cc9\u8109\u3002 \u5f52\u71d5\u8bc6\u6545\u5de2\uff0c\u65e7\u4eba\u770b\u65b0\u5386\u3002\u4e34\u89de\u5ffd\u4e0d\u5fa1\uff0c\u60c6\u6005\u8fdc\u884c\u5ba2\u3002\n\u79ef\u96e8\u7a7a\u6797\u70df\u706b\u8fdf\uff0c\u84b8\u85dc\u708a\u9ecd\u9977\u4e1c\u83d1\u3002\u6f20\u6f20\u6c34\u7530\u98de\u767d\u9e6d\uff0c\u9634\u9634\u590f\u6728\u556d\u9ec4\u9e42\u3002\u5c71\u4e2d\u4e60\u9759\u89c2\u671d\u69ff\uff0c\u677e\u4e0b\u6e05\u658b\u6298\u9732\u8475\u3002\u91ce\u8001\u4e0e\u4eba\u4e89\u5e2d\u7f62\uff0c\u6d77\u9e25\u4f55\u4e8b\u66f4\u76f8\u7591\u3002\n\u592a\u865a\u751f\u6708\u6655\uff0c\u821f\u5b50\u77e5\u5929\u98ce\u3002\u6302\u5e2d\u5019\u660e\u53d1\uff0c\u6e3a\u6f2b\u5e73\u6e56\u4e2d\u3002\u4e2d\u6d41\u89c1\u5321\u961c\uff0c\u52bf\u538b\u4e5d\u6c5f\u96c4\u3002\u9eef\u9eee\u51dd\u9edb\u8272\uff0c\u5ce5\u5d58\u5f53\u66d9\u7a7a\u3002\u9999\u7089\u521d\u4e0a\u65e5\uff0c\u7011\u6c34\u55b7\u6210\u8679\u3002\u4e45\u6b32\u8ffd\u5c1a\u5b50\uff0c\u51b5\u5179\u6000\u8fdc\u516c\u3002\u6211\u6765\u9650\u4e8e\u5f79\uff0c\u672a\u6687\u606f\u5fae\u8eac\u3002\u6dee\u6d77\u9014\u5c06\u534a\uff0c\u661f\u971c\u5c81\u6b32\u7a77\u3002\u5bc4\u8a00\u5ca9\u6816\u8005\n\u7d2b\u9752\u83bc\u83dc\u5377\u8377\u9999\uff0c\u7389\u96ea\u82b9\u82bd\u62d4\u85a4\u957f\u3002\u81ea\u64b7\u6eaa\u6bdb\u5145\u665a\u4f9b\uff0c\u77ed\u7bf7\u98ce\u96e8\u5bbf\u6a2a\u5858\u3002\u6e56\u83b2\u65e7\u8361\u85d5\u65b0\u7ffb\uff0c\u5c0f\u5c0f\u8377\u94b1\u6ca1\u6da8\u75d5\u3002\u659f\u914c\u6885\u5929\u98ce\u6d6a\u7d27\uff0c\u66f4\u4ece\u5916\u6c34\u79cd\u82a6\u6839\u3002\u80e1\u8776\u53cc\u53cc\u5165\u83dc\u82b1\uff0c\u65e5\u957f\u65e0\u5ba2\u5230\u7530\u5bb6\u3002\u9e21\u98de\u8fc7\u7bf1\u72ac\u5420\u7aa6\uff0c\u77e5\u6709\u884c\u5546\u6765\u4e70\u8336\u3002\u6e54\u88d9\u6c34\u6ee1\u7eff\n\u6843\u7ea2\u590d\u542b\u5bbf\u96e8\uff0c\u67f3\u7eff\u66f4\u5e26\u671d\u70df\u3002\u82b1\u843d\u5bb6\u7ae5\u672a\u626b\uff0c\u83ba\u557c\u5c71\u5ba2\u72b9\u7720\u3002\n\u659c\u9633\u7167\u589f\u843d\uff0c\u7a77\u5df7\u725b\u7f8a\u5f52\u3002\u91ce\u8001\u5ff5\u7267\u7ae5\uff0c\u501a\u6756\u5019\u8346\u6249\u3002\u96c9\u96ca\u9ea6\u82d7\u79c0\uff0c\u8695\u7720\u6851\u53f6\u7a00\u3002\u7530\u592b\u8377\u9504\u81f3\uff0c\u76f8\u89c1\u8bed\u4f9d\u4f9d\u3002\u5373\u6b64\u7fa1\u95f2\u9038\uff0c\u6005\u7136\u541f\u5f0f\u5fae\u3002\n\u65b0\u6674\u539f\u91ce\u65f7\uff0c\u6781\u76ee\u65e0\u6c1b\u57a2\u3002\u90ed\u95e8\u4e34\u6e21\u5934\uff0c\u6751\u6811\u8fde\u8c3f\u53e3\u3002 \u767d\u6c34\u660e\u7530\u5916\uff0c\u78a7\u5cf0\u51fa\u5c71\u540e\u3002\u519c\u6708\u65e0\u95f2\u4eba\uff0c\u503e\u5bb6\u4e8b\u5357\u4ea9\u3002\n\u60a0\u60a0\u6e05\u6c5f\u6c34\uff0c\u6c34\u843d\u6c99\u5c7f\u51fa\u3002\u56de\u6f6d\u77f3\u4e0b\u6df1\uff0c\u7eff\u7b71\u5cb8\u508d\u5bc6\u3002 \u9c9b\u4eba\u6f5c\u4e0d\u89c1\uff0c\u6e14\u7236\u6b4c\u81ea\u9038\u3002\u5fc6\u4e0e\u541b\u522b\u65f6\uff0c\u6cdb\u821f\u5982\u6628\u65e5\u3002 \u5915\u9633\u5f00\u8fd4\u7167\uff0c\u4e2d\u5750\u5174\u975e\u4e00\u3002\u5357\u671b\u9e7f\u95e8\u5c71\uff0c\u5f52\u6765\u6068\u5982\u5931\u3002\n\u5f0a\u5e90\u9694\u5c18\u55a7\uff0c\u60df\u5148\u517b\u606c\u7d20\u3002\u535c\u90bb\u8fd1\u4e09\u5f84\uff0c\u690d\u679c\u76c8\u5343\u6811\u3002\u7ca4\u4f59\u4efb\u63a8\u8fc1\uff0c\u4e09\u5341\u72b9\u672a\u9047\u3002\u4e66\u5251\u65f6\u5c06\u665a\uff0c\u4e18\u56ed\u65e5\u5df2\u66ae\u3002\u6668\u5174\u81ea\u591a\u6000\uff0c\u663c\u5750\u5e38\u5be1\u609f\u3002\u51b2\u5929\u7fa1\u9e3f\u9e44\uff0c\u4e89\u98df\u7f9e\u9e21\u9e5c\u3002\u671b\u65ad\u91d1\u9a6c\u95e8\uff0c\u52b3\u6b4c\u91c7\u6a35\u8def\u3002\u4e61\u66f2\u65e0\u77e5\u5df1\uff0c\u671d\u7aef\u4e4f\u4eb2\u6545\u3002\u8c01\u80fd\u4e3a\u626c\u96c4\n\u6c34\u4ead\u51c9\u6c14\u591a\uff0c\u95f2\u68f9\u665a\u6765\u8fc7\u3002\u6da7\u5f71\u89c1\u677e\u7af9\uff0c\u6f6d\u9999\u95fb\u82b0\u8377\u3002 \u91ce\u7ae5\u6276\u9189\u821e\uff0c\u5c71\u9e1f\u52a9\u9163\u6b4c\u3002\u5e7d\u8d4f\u672a\u4e91\u904d\uff0c\u70df\u5149\u5948\u5915\u4f55\u3002\n\u5fae\u96e8\u4f17\u5349\u65b0\uff0c\u4e00\u96f7\u60ca\u86f0\u59cb\u3002\u7530\u5bb6\u51e0\u65e5\u95f2\uff0c\u8015\u79cd\u4ece\u6b64\u8d77\u3002\u4e01\u58ee\u4ff1\u5728\u91ce\uff0c\u573a\u5703\u4ea6\u5c31\u7406\u3002\u5f52\u6765\u666f\u5e38\u664f\uff0c\u996e\u728a\u897f\u6da7\u6c34\u3002\u9965\u52ac\u4e0d\u81ea\u82e6\uff0c\u818f\u6cfd\u4e14\u4e3a\u559c\u3002\u4ed3\u7980\u65e0\u5bbf\u50a8\uff0c\u5fad\u5f79\u72b9\u672a\u5df2\u3002\u65b9\u60ed\u4e0d\u8015\u8005\uff0c\u7984\u98df\u51fa\u95fe\u91cc\u3002\n\u8001\u519c\u5bb6\u8d2b\u5728\u5c71\u4f4f\uff0c\u8015\u79cd\u5c71\u7530\u4e09\u56db\u4ea9\u3002\u82d7\u758f\u7a0e\u591a\u4e0d\u5f97\u98df\uff0c\u8f93\u5165\u5b98\u4ed3\u5316\u4e3a\u571f\u3002\u5c81\u66ae\u9504\u7281\u508d\u7a7a\u5ba4\uff0c\u547c\u513f\u767b\u5c71\u6536\u6a61\u5b9e\u3002\u897f\u6c5f\u8d3e\u5ba2\u73e0\u767e\u659b\uff0c\u8239\u4e2d\u517b\u72ac\u957f\u98df\u8089\u3002\n\u6d6e\u4e16\u4e8b\u65e0\u9650\uff0c\u4f55\u987b\u8981\u5230\u5934\u3002\u58ee\u5fc3\u4e3a\u5ba2\u5c3d\uff0c\u5b64\u8ff9\u5367\u4e91\u4f11\u3002\u5323\u5251\u5df2\u5168\u5f03\uff0c\u6797\u50e7\u4ea6\u5c11\u916c\u3002\u4ece\u6765\u6101\u6068\u610f\uff0c\u4e5e\u5f85\u5916\u4eba\u6101\u3002\n\u4e91\u5c45\u5c71\u5ba2\u8349\u4e3a\u978b\uff0c\u8def\u8f6c\u5343\u5cf0\u6b64\u5bc4\u6765\u3002\u6628\u65e5\u516c\u4f59\u5077\u6b65\u8e51\uff0c\u4e07\u7aef\u5fc3\u7eea\u5fc6\u5929\u53f0\u3002\n\u8700\u4e2d\u6625\u8273\u4e16\u95f4\u6b8a\uff0c\u6bd4\u7add\u9648\u56ed\u6050\u672a\u5982\u3002\u6570\u91cc\u82b1\u5149\u6d6e\u6696\u65e5\uff0c\u516d\u8857\u5c18\u51c0\u89c1\u9999\u8f66\u3002\u7ffb\u7a7a\u96c5\u4e50\u50ac\u6b22\u5904\uff0c\u5165\u683c\u65b0\u8bd7\u4e0a\u677f\u521d\u3002\u65b9\u4fe1\u627f\u5e73\u65e0\u4e00\u4e8b\uff0c\u6dee\u9633\u9592\u6740\u8001\u5c1a\u4e66\u3002\n\u8c01\u8a00\u7530\u5bb6\u4e50\uff0c\u6240\u4e50\u4ea6\u5c82\u5e38\u3002\u8015\u655b\u7a0d\u4e0d\u7ed9\uff0c\u4e30\u6b49\u590d\u76f8\u5f53\u3002\u4e94\u6708\u4e86\u8695\u4e8b\uff0c\u5341\u6708\u767b\u7a3b\u7cb1\u3002\u6240\u5165\u4e0d\u507f\u7528\uff0c\u95f2\u5c11\u5b9e\u591a\u5fd9\u3002\u8425\u8425\u4e8b\u516c\u79c1\uff0c\u52b3\u82e6\u8fc7\u5373\u5fd8\u3002\u5c81\u529f\u5df2\u544a\u6bd5\uff0c\u8721\u793e\u805a\u4e00\u65b9\u3002\u914c\u9152\u5bb0\u9e21\u8c5a\uff0c\u9f13\u8179\u5750\u5c71\u9633\u3002\u5b81\u77e5\u6731\u95e8\u5185\uff0c"})}function l(n={}){const{wrapper:e}={...(0,i.R)(),...n.components};return e?(0,o.jsx)(e,{...n,children:(0,o.jsx)(d,{...n})}):d(n)}},28453:(n,e,t)=>{t.d(e,{R:()=>s,x:()=>c});var r=t(96540);const o={},i=r.createContext(o);function s(n){const e=r.useContext(i);return r.useMemo((function(){return"function"==typeof n?n(e):{...e,...n}}),[e,n])}function c(n){let e;return e=n.disableParentContext?"function"==typeof n.components?n.components(o):n.components||o:s(n.components),r.createElement(i.Provider,{value:e},n.children)}}}]);